import Home from './guest_homepage/home'
import styled from 'styled-components'

const GlassDiv = styled.div`
  position: absolute;
  top : 0;
  left : 0;
  z-index : 100;
  width : 97.7%;
  height : 95%;
  padding : 20px;
  background : rgba(240,240,240,0.4);
  backdrop-filter : blur(6px);
`

function App() {
  return (
    <>

      <Home />
    </>
  );
}

export default App;
